import Vue from 'vue'
import VueRouter from 'vue-router'
import HomeView from '../views/HomeView.vue'
import LogIn from '../views/LogIn.vue'
import SeLect from '../views/Pust_Pro.vue'
import ManageMent from '../views/ManageMent.vue'
import CRUDAdd from '../views/CURDAdd.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },  
  {
    path: '/login',
    name: 'LogIn',
    component: LogIn
  },
  {
    path: '/select',
    name: 'SeLect',
    component: SeLect
  },
  {
    path: '/management',
    name: 'ManageMent',
    component: ManageMent
  },
  {
    path: '/CRUDAdd',
    name: 'CRUDAdd',
    component: CRUDAdd
  },


]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
